import React from 'react';
function Navlist(props){
    if(props.name==='Bubble Sort'){
        return(
            <li className="nav-item">
                <a href={props.useref} className="nav-link dropdown active" onClick={()=>window.open('localhost:3000/Bubblesort','_blank')} >{props.name}</a>
            </li>
        );
    }
    else if(props.name==='Insertion Sort'){
        return(
            <li className="nav-item">
                <a href={props.useref} className="nav-link dropdown active" onClick={()=>window.open('localhost:3000/','_blank')} >{props.name}</a>
            </li>
        );
    }
    else if(props.name==='Selection Sort'){
        return(
            <li className="nav-item">
                <a href={props.useref} className="nav-link dropdown active">{props.name}</a>
            </li>
        );
    }
    else if(props.name==='Merge Sort'){
        return(
            <li className="nav-item">
                <a href={props.useref} className="nav-link dropdown active">{props.name}</a>
            </li>
        );
    }
    // else{
    //     return(
    //         <li className="nav-item">
    //             <a href={props.useref} className="nav-link dropdown">{props.name}</a>
    //         </li>
    //     );
    // }
}
export default Navlist;
